import React from "react";
import p from './Profile.module.css'
import MyPosts from "./MyPosts/MyPosts";
import ProfileInfo from "./ProfileInfo/ProfileInfo";

function Profile() {
    return (
        <div className={p.content}>
            <ProfileInfo/>
            <MyPosts/>
        </div>
    );
}

export default Profile;
